// ==UserScript==
// @name         AtCoder WA Instant Notifier
// @namespace    http://tampermonkey.net/
// @version      1.3
// @description  AtCoderでWAが確定した瞬間に音を鳴らす
// @author       You
// @match        https://atcoder.jp/contests/*/submissions*
// @grant        none
// @license      MIT
// @downloadURL https://update.greasyfork.org/scripts/540324/AtCoder%20WA%20Instant%20Notifier.user.js
// @updateURL https://update.greasyfork.org/scripts/540324/AtCoder%20WA%20Instant%20Notifier.meta.js
// ==/UserScript==

(function() {
    'use strict';

    const waSoundUrl = "data:audio/mp3;base64,";

   const observer = new MutationObserver(mutations => {
        for (const mutation of mutations) {
            for (const node of mutation.addedNodes) {
                if (!(node instanceof HTMLElement)) continue;

                // WA 判定セルを監視
                if (node.matches("td[data-judge='WA']")) {
                    const color = getComputedStyle(node).color;
                    const isYellow = color.includes("rgb(255") || color.includes("hsl(45") || color.includes("黄色");

                    if (isYellow) {
                        const audio = new Audio(waSoundUrl);
                        audio.play();
                    }
                }
            }

            // 属性の変化による判定変更
            if (mutation.type === "attributes" && mutation.attributeName === "data-judge") {
                const target = mutation.target;
                if (target instanceof HTMLElement &&
                    target.getAttribute("data-judge") === "WA") {
                    const audio = new Audio(waSoundUrl);
                    audio.play();
                }
            }
        }
    });

    // 提出テーブルを監視
    const table = document.querySelector("table.table");
    if (table) {
        observer.observe(table, {
            childList: true,
            subtree: true,
            attributes: true,
            attributeFilter: ["data-judge"]
        });
    }
})();